$this->insert('{{%course_description}}',['code'=>'FSK10111','description'=>'Mata kuliah ini mengajarkan topik-topik berikut: Besaran Fisis dan Vektor, Gerak dalam satu, dua, dan tiga dimensi, Hukum Newton, Aplikasi Hukum Newton, Kerja dan Energi Kinetik, Energi Potensial dan Kekekalan Energi, Momentum, Impuls dan Tumbukan, Gravitasi, Benda Tegar dan Rotasi Benda Tegar, Dinamika Gerak Rotasi, Statika dan Elastisitas, Mekanika Fluida, Gerak Periodik, Temperatur, Kalor dan Hukum, Termodinamika']);
$this->insert('{{%course_description}}',['code'=>'FSK10112','description'=>'Mata kuliah ini mengajarkan topik-topik berikut: Muatan Listrik, Hukum Coulomb dan Medan Listrik, Hukum Gauss, Potensial Listrik, Kapasitansi dan Dielektrik, Arus Listrik Searah, Resistansi dan Rangkaian Arus Searah, Medan Magnetik dan Gaya Magnetik, Sumber Medan Magnetik dan Hukum Ampere, Induksi Elektro-magnetik, Induktansi, Arus Bolak-Balik, Gelombang (umum, mekanik & e.m. Bunyi, Gelombang Elektro-magnetik, Sifat dasar & Perambatan Cahaya, Polarisasi Cahaya, Interferensi Gelombang Cahaya']);
$this->insert('{{%course_description}}',['code'=>'IKI10100','description'=>'Dalam mata kuliah ini, mahasiswa akan memperoleh pemahaman tentang matematika diskret yang sesuai untuk aplikasi komputer. Topik yang dibahas meliputi logika proposisional, logika predikat, teori himpunan, fungsi, teori bilangan, metode pembuktian, induksi matematika, prinsip pigeonhole, permutasi, dan kombinasi']);
$this->insert('{{%course_description}}',['code'=>'IKI10103','description'=>'Mata kuliah ini mempersiapkan mahasiswa untuk dapat menyelesaikan masalah yang terkait dengan aljabar matriks dan konsep ruang vektor. Di samping itu, mata kuliah ini membekali mahasiswa dengan logical reasoning dan abstraksi matematika. Oleh karena itu, keterlibatan aktif dari mahasiswa merupakan keharusan']);
$this->insert('{{%course_description}}',['code'=>'IKI10200','description'=>'Mata kuliah ini bertujuan untuk mengajarkan konsep-konsep dasar serta teknik untuk membuat program komputer menggunakan paradigma berorientasi obyek pada bahasa pemrograman Java. Mata kuliah ini diajarkan melalui kombinasi kuliah tatap muka serta sesi latihan pemrograman di mana setiap peserta kuliah mengakses PC yang tersambung ke Internet. Mata kuliah ini memraktekkan prinsip di mana pemrograman tidak bisa diajarkan dalam cara yang sepenuhnya linier, namun topik-topik awal tetap dibahas lagi di belakang dengan tingkat kedalaman yang lebih canggih']);
$this->insert('{{%course_description}}',['code'=>'IKI10400','description'=>'Mata kuliah ini mengajarkan teknik dasar untuk mengabstraksikan data, membuat algoritma yang dapat mengakses data tersebut, dan memanipulasi struktur abstrak tersebut. Pada mata kuliah ini juga akan diperkenalkan analisa kompleksitas ruang dan waktu dalam mengimplementasikan sebuah algoritma. Topik-topik yang dibahas meliputi: konsep tipe data abstrak, model data linier (array dan dynamic list, stack dan queue), himpunan, model data hirarkis (binary tree, heap, binary search tree, AVL-tree, B-Tree), model graph, hashtable, algoritme pelacakan.']);
$this->insert('{{%course_description}}',['code'=>'IKI20101','description'=>'Mata kuliah ini merupakan kelanjutan dari mata kuliah Matematika Diskret 1 dan memberikan landasan yang lebih teoritis untuk ilmu komputer. Mata kuliah ini mencakup teori kombinatorik, relasi, dan graph']);
$this->insert('{{%course_description}}',['code'=>'IKI20102','description'=>'Mata kuliah ini memberikan penguasaan tentang pokok bahasan mengenai konsep peluang dan peubah acak, statistika deskriptif dan uji hipotesis, simulasi dan pemodelan non-deterministik, estimasi parameter dan regresi, serta teori antrian.']);
$this->insert('{{%course_description}}',['code'=>'IKI20201','description'=>'HTML dan CSS, yang merupakan komponen dasar dari halaman web, merupakan dua topik pertama yang dibahas dalam mata kuliah ini. Mata kuliah ini kemudian membahas penampilan web secara dinamis menggunakan Javascript. Javascript juga merupakan dasar pemrograman Ajax yang juga akan diperkenalkan pada akhir kuliah ini. Pemrograman dari sisi server juga akan dibahas dengan menggunakan bahasa PHP dan ASP. Untuk memperkaya presentasi web, topik ini juga membahas pembuatan gambar untuk halaman web dan presentasi dinamis']);
$this->insert('{{%course_description}}',['code'=>'IKI20505','description'=>'Mata kuliah ini akan dimulai dengan pengenalan singkat dari sistem operasi, hubungan antara hardware dan sistem operasi, dan beberapa komponen utama dari sebagian besar sistem operasi. Mata kuliah ini membahas trade-off yang mungkin muncul antara kinerja dan fungsionalitas dalam perancangan dan implementasi sistem operasi. Penekanan khusus akan diberikan kepada subsistem utama sebuah sistem operasi, yaitu manajemen proses (proses, thread, penjadwalan CPU, sinkronisasi, dan deadlock), manajemen memori (segmentasi, paging, swapping), sistem file, penyimpanan sekunder dan dukungan sistem operasi untuk sistem terdistribusi']);
$this->insert('{{%course_description}}',['code'=>'IKI20505','description'=>'Mata kuliah ini akan dimulai dengan pengenalan singkat dari sistem operasi, hubungan antara hardware dan sistem operasi, dan beberapa komponen utama dari sebagian besar sistem operasi. Mata kuliah ini membahas trade-off yang mungkin muncul antara kinerja dan fungsionalitas dalam perancangan dan implementasi sistem operasi. Penekanan khusus akan diberikan kepada subsistem utama sebuah sistem operasi, yaitu manajemen proses (proses, thread, penjadwalan CPU, sinkronisasi, dan deadlock), manajemen memori (segmentasi, paging, swapping), sistem file, penyimpanan sekunder dan dukungan sistem operasi untuk sistem terdistribusi']);
$this->insert('{{%course_description}}',['code'=>'IKI20700','description'=>'Mata kuliah ini membahas konsep dasar dari manajemen database yang mencakup aspek pemodelan dan desain, bahasa dan fasilitas, implementasi dan penggunaan database. Topik yang diajarkan meliputi: arsitektur dan konsep sistem manajemen basis data (DBMS), struktur dan organisasi file, indexing, pemodelan data menggunakan model entity-relationship, pemodelan data menggunakan model relasional, bahasa kueri formal, aljabar relasional, basisdata berorientasi obyek, SQL dan QBE, functional dependency, normalisasi basis data relasional, algoritma dan proses desain basis data relasional, pemrosesan serta optimasi kueri, transaksi, kendali konkurensi, pemulihan basis data serta basis data client-server']);
$this->insert('{{%course_description}}',['code'=>'IKI30202','description'=>'Mata kuliah ini mencakup siklus pengembangan perangkat lunak, yang terdiri dari perencanaan, analisis, desain, coding, pengujian dan pemeliharaan. Pada mata kuliah ini, mahasiswa membentuk sebuah kelompok dan mengembangkan proyek yang akan dilakukan selama satu semester. Topik yang tercakup dalam mata kuliah ini adalah: metodologi pengembangan perangkat lunak, rekayasa perangkat lunak berbantuan komputer (CASE tool); perencanaan proyek pengembangan perangkat lunak, analisis permasalahan dan kebutuhan pengguna; pengorganisasian spesifikasi perangkat lunak; prinsip dasar perancangan perangkat lunak; masalah-masalah dalam pengkodean, penjaminan kualitas perangkat lunak; pengukuran kualitas perangkat lunak; pengujian perangkat lunak, pemeliharaan perangkat lunak']);
$this->insert('{{%course_description}}',['code'=>'IKI40902','description'=>'Mata kuliah ini memberikan kesempatan kepada mahasiswa untuk memperoleh pengalaman dalam penyelesaian permasalahan yang terdapat pada sebuah organisasi menggunakan Teknologi Informasi dan Komunikasi (TIK) dengan cara terjun secara langsung ke dunia kerja']);
$this->insert('{{%course_description}}',['code'=>'IKI40903','description'=>'Mata kuliah ini menimbulkan kesadaran dan kepekaan mahasiswa terhadap berbagai persoalan sosial dan ekonomi terkait penerapan teknologi komputer dalam kehidupan sehari-hari. Mahasiswa diharapkan mampu merespon positif terhadap masalah-masalah sosial yang ada dalam konteks disiplin ilmu komputer. Mahasiswa akan dihadapkan pada isu-isu yang berkaitan dengan IT, dan diharapkan mampu menganalisa isu tersebut dan memberikan solusi dari sudut pandang mereka sebagai mahasiswa ilmu komputer']);
$this->insert('{{%course_description}}',['code'=>'IKI40999','description'=>'Mata kuliah ini melatih kemampuan mahasiswa untuk mengembangkan bidang ilmu/teknologi atau melanjutkan studinya. Pada mata kuliah ini, mahasiswa akan mengerjakan suatu topik penelitian secara mandiri di bawah bimbingan seorang dosen. Topik penelitian yang dikerjakan harus terkait dengan kegiatan salah satu lab riset di Fasilkom UI. Mahasiswa harus menuliskan laporan ilmiah mengenai pekerjaannya dan mempertahankannya pada Sidang Tugas Akhir.']);
$this->insert('{{%course_description}}',['code'=>'IKO12500','description'=>'Mata kuliah ini memberikan pemahaman dasar dan pengalaman praktis dalam merancang sistem dijital yang menjadi dasar sebuah komputer. Peserta akan mempelajari konsep-konsep dalam operasi rangkaian digital dan cara merancang dan mensimulasikan rangkaian digital dengan alat bantu dan teknik yang mutakhir. Topik yang dibahas meliputi: sistem bilangan biner; dasar rangkaian digital: logika biner, gerbang logika, aljabar Boolean, bentuk standar fungsi Boolean, representasi, penyederhanaan dan manipulasi fungsi Boolean dengan Karnaugh-Map; rangkaian kombinasi: prosedur analisis & perancangan rangkaian kombinasi, rangkaian aritmatika, decoder, multiplexer; rangkaian sekuensial: latch, flip-flop, characteristic table, excitation table, state table, state diagram, propagation delay, analisis dan perancangan rangkaian sekuensial; rangkaian register dan counter; memori & programmable logic']);
$this->insert('{{%course_description}}',['code'=>'IKO21502','description'=>'Mata kuliah ini mengajarkan dasar-dasar organisasi komputer sekuensial, yang terdiri dari komponen- komponen: input, output, memori, dan prosesor (kontrol dan datapath). Pemahaman akan konsep- konsep ini juga akan disampaikan melalui latihan pemrograman dengan bahasa tingkat rendah (low- level language) seperti bahasa rakitan (assembly language).']);
$this->insert('{{%course_description}}',['code'=>'IKO22203','description'=>'Tujuan dari mata kuliah ini adalah untuk memperkenalkan prinsip-prinsip pemrograman deklaratif, dalam hal ini dengan paradigma pemrograman fungsional, menggunakan bahasa pemrograman ML. Mata kuliah ini mengilustrasikan prinsip-prinsip deklaratif menggunakan fitur-fitur utama dari ML seperti tipe data terstruktur, fungsi orde tinggi, serta pemeriksaan tipe. Aplikasi dan penerapan aspek-aspek ini akan didemonstrasikan melalui serangkaian studi kasus']);
$this->insert('{{%course_description}}',['code'=>'IKO22401','description'=>'Mata kuliah ini membahas model teoritis tentang komputasi serta bahasa formal yang melandasi semua sistem komputer. Topik-topik yang dibahas meliputi: finite state automata dan bahasa reguler, pushdown automata dan bahasa context-free, mesin Turing dan bahasa recursively enumerable, masalah decision dan (un)decidability.']);
$this->insert('{{%course_description}}',['code'=>'IKO31204','description'=>'Mata kuliah ini akan mendalami konsep-konsep sebuah sistem operasi, khususnya GNU/Linux, dengan penekanan khusus pada kemampuan praktis untuk mengimplementasikan dan memodifikasi program di bawah lapisan aplikasi. Para peserta akan diperkenalkan pada berbagai lapisan implementasi dari sebuah sistem operasi, seperti pengelolaan proses, sistem berkas, IPC, soket jaringan, dan struktur kernel. Latihan dan tugas akan menggunakan bahasa C/C++, serta beberapa perangkat scripting untuk memanipulasi berkas']);
$this->insert('{{%course_description}}',['code'=>'IKO31250','description'=>'Mata kuliah akan membekali mahasiswa dengan pengetahuan mengenai perancangan antarmuka untuk perangkat lunak. Materi yang dibahas meliputi rancangan, implementasi, dan evaluasi antarmuka dengan pengguna perangkat lunak. Topik-topik spesifiknya adalah sistem pengolahan informasi pada manusia, model interaksi manusia komputer, proses perancangan, menu interaksi, bahasa perintah, antarmuka grafis, gaya interaksi, manipulasi langsung, alat bantu, manual, bantuan, serta tutorial']);
$this->insert('{{%course_description}}',['code'=>'IKO31258','description'=>'Mata kuliah ini mencakup teori konkurensi dan paralelisme, sejarah mesin berkinerja tinggi, dan cara pemanfaatan fasilitas komputasi kinerja tinggi seperti komputasi pada Cluster dan GPU. Mahasiswa akan diajarkan teori mengenai paradigma pemrograman paralel, konsep mesin SIMD dan MIMD, serta isu-isu seperti shared memory, mutual exclusion, dan semaphores, dan juga dibekali dengan pengetahuan praktis mengenai standar-standar terkini seperti Open MP, CUDA, dst']);
$this->insert('{{%course_description}}',['code'=>'IKO31300','description'=>'Mata kuliah ini memperkenalkan berbagai jenis teknik dan sub-bidang kecerdasan buatan (Artificial Intelligence). Peserta akan dibekali dengan pemahaman teoritis mengenai isu-isu yang dihadapi dalam pengembangan agen (dan sistem multi-agen) yang cerdas dan otonom, serta pengetahuan praktis dalam membangun dan memrogram agen-agen tersebut. Topik kuliah ini meliputi konsep state- space search (termasuk heuristic dan local search), pendekatan logika terhadap representasi pengetahuan serta penalaran, serta pendekatan probabilistik terhadap kecerdasan buatan, misalnya jaringan Bayesian dan pemelajaran mesin']);
$this->insert('{{%course_description}}',['code'=>'IKO31350','description'=>'Mata kuliah ini memperkenalkan peserta kuliah terhadap sumber daya yang dibutuhkan untuk menerapkan berbagai pendekatan kecerdasan buatan untuk menghasilkan informasi pada aplikasi biologi seperti: fungsi gen, struktur protein dan evolusi molekular. Peserta akan diajarkan metode untuk penambangan serta analisa data untuk melakukan pencocokan sekuen, pencarian kemiripan, analisa filogenetik, pencarian gen serta prediksi struktur protein']);
$this->insert('{{%course_description}}',['code'=>'IKO31355','description'=>'Mata kuliah ini membahas metodologi pengolahan data berupa citra atau image 2D, serta konsep dasar pengenalan pola (pattern recognition), yang dapat diaplikasikan pada berbagai bidang seperti penginderaan jauh, diagnosa medis, pengolahan dokumen, robotika, dll. Topik yang akan dibahas antara lain konsep dasar citra dijital, transformasi citra, peningkatan mutu dan restorasi, pemampatan, segmentasi, serta klasifikasi citra. Mahasiswa akan dilatih dengan tugas pemrograman menggunakan bahasa C++, Java, atau Matlab, baik secara individu maupun kelompok']);
$this->insert('{{%course_description}}',['code'=>'IKO31503','description'=>'Mata kuliah ini memperkenalkan jaringan komputer, dan membekali peserta dengan pemahaman terhadap aplikasi-aplikasi jaringan komputer serta bagaimana cara kerjanya pada lapisan-lapisan bawah']);
$this->insert('{{%course_description}}',['code'=>'IKO31550','description'=>'Mata kuliah ini berisi pembahasan rinci komponen utama sistem komputer : prosesor, memory dan masukan/keluaran. Penekanan ditujukan pada analisa dan teknik peningkatan kinerja (performance) dari sistem komputer. Topik-topik yang dibahas meliputi pengantar rancangan komputer, perspektif historis; komponen dari sistem komputer, organisasi dasar mesin komputer; kinerja dan biaya, pilihan dalam rancangan; realisasi organisasi sistem komputer; RISC; implementasi dan analisa perangkat instruksi pada contoh-contoh organisasi sistem komputer yang diberikan; rancangan prosesor: data path unit dan pengendali prosesor, micro programming dan hardwired control; rancangan memory : cache memory, pipelining; masukan dan keluaran (I/O)']);
$this->insert('{{%course_description}}',['code'=>'IKO31551','description'=>'Sistem tertanam (Embedded System) merupakan sistem berbasis mikrokontroler dan merupakan perpaduan antara hardware dan software untuk suatu fungsi tertentu. Sejak ditemukan mikroprosesor awal tahun 70an, teknologi dan aplikasi sistem tertanam berkembang sangat pesat dan merambah ke berbagai aspek kehidupan manusia seperti mobile devices (handphones, MP3 players, dsb), medical systems, robotics, automations, dsb. Mata kuliah ini ditujukan untuk memberikan bekal untuk perancangan sistem tertanam, terutama dari aspek kemampuan menghasilkan software yang handal.']);
$this->insert('{{%course_description}}',['code'=>'IKO31754','description'=>'Mata kuliah ini merupakan kelanjutan dari mata kuliah Basis Data. Mata kuliah ini akan mencakup topik-topik lanjutan terkait dengan implementasi atau pengembangan Sistem Manajemen Basis data (DBMS), antara lain pengorganisasian data secara fisik, monitoring dan tuning kinerja operasional, pemrosesan transaksi, kendali konkurensi, database recovery, pemrosesan dan optimisasi kueri']);
$this->insert('{{%course_description}}',['code'=>'IKO31900','description'=>'Mata kuliah ini dirancang untuk memperkaya pemahaman peserta kuliah akan struktur dan penulisan paper ilmiah. Penulisan ilmiah mencakup pemahaman proses menulis, teknik-teknik yang digunakan dalam menulis, dan kegiatan menulis itu sendiri. Pengembangan penulisan seharusnya merupakan pendekatan yang terpadu antara manusia, data, informasi, pengetahuan, dan alat bantu yang menghasilkan tulisan ilmiah yang benar dan mudah dibaca']);
$this->insert('{{%course_description}}',['code'=>'IKO32104','description'=>'Mata kuliah ini membahas dasar-dasar penerapan komputasi ilmiah untuk ilmu komputer. Topik yang dibahas meliputi prinsip-prinsip matematika dasar serta algoritma analisa numerik sampai pada isu-isu praktis seperti reliabilitas perangkat lunak dan kinerja pada perangkat keras mutakhir. Peserta dilatih membuat program dengan bahasa C atau Matlab melalui tugas-tugas pemrograman']);
$this->insert('{{%course_description}}',['code'=>'IKO32150','description'=>'Teori informasi mempelajari batas-batas mendasar dalam transmisi dan penyimpanan informasi. Mata kuliah ini memberikan pengenalan umum mengenai teori informasi serta aplikasinya: entropy dan informasi, kompresi data, komunikasi dengan munculnya derau, kapasitas, pengkodean pada kanal, pemisahan kanal sumber, probabilitas serta penalaran.']);
$this->insert('{{%course_description}}',['code'=>'IKO32152','description'=>'Mata kuliah ini dirancang untuk memberikan pemahaman dan pengetahuan mengenai berbagai jenis persamaan diferensial yang ada, metode penyelesaiannya, serta penerapannya dalam berbagai bidang. Mata kuliah ini menitikberatkan pemodelan matematis berbagai jenis sistem fisika dengan menggunakan beragam persamaan diferensial']);
$this->insert('{{%course_description}}',['code'=>'IKO32205','description'=>'Mata kuliah ini memberikan pengalaman kepada peserta kuliah untuk terlibat secara aktif dalam sebuah proyek IT selama satu semester. Peserta diharapkan dapat mensintesa dan mengimplementasikan ilmu yang sudah didapatkan dari mata kuliah-mata kuliah terkait untuk membangun sebuah proyek IT. Peserta akan bekerja dalam tim yang terdiri dari 4 sampai dengan 5 anggota. Setiap anggota harus berpartisipasi aktif dalam setiap peran proyek IT, yaitu manajemen proyek, analisa kebutuhan, rancangan, implementasi, serta pengujian. Setiap anggota juga harus berpartisipasi pada setiap tahap pengembangan perangkat lunak, yakni komunikasi, perencanaan, pemodelan, pembangunan, serta operasionalisasi. Sebuah proyek IT selama satu semester diberikan kepada satu atau lebih tim, tergantung dari ruang lingkup serta tingkat kompleksitas proyek tersebut. Masalah proyek yang diberikan akan berupa masalah nyata, dengan pengguna yang nyata juga. Selama pengembangan proyek, setiap tim akan bertemu beberapa kali dengan pengguna, selain pertemuan internal tim. Setiap pertemuan tercatat melalui Minutes of Meetings (MoMs), yang akan menjadi bahan pertimbangan untuk penilaian. Setiap tim harus mempresentasikan kemajuan secara mingguan kepada dosen dan/atau asisten dosen mata kuliah. Masalah yang dihadapi selama proses 176 pengembangan akan dibahas pada pertemuan mingguan. Pada akhir semester, semua tim harus mendemokan proyeknya di hadapan pengguna, dosen, serta asisten dosen mata kuliah. Selain itu, akan ada juga sesi kuliah tamu dengan praktisi IT ternama yang akan membagikan ilmu dan pengalaman dalam manajemen dan pengembangan proyek IT']);
$this->insert('{{%course_description}}',['code'=>'IKO32257','description'=>'Mata kuliah ini membahas beberapa teknik pembuatan kompilator untuk sebuah bahasa pemrograman yang didefinisikan oleh tata bahasa tertentu. Teknik-teknik ini akan dibahas sesuai dengan tahapan pemrosesan sebuah kompilator, yaitu pembacaan kode sumber, analisis tata bahasa, serta pembentukan kode. Topik-topik yang dibahas antara lain analisis leksikal, tabel simbol, parsing, syntax-directed translation, type checking, target code generation, optimasi kode, dst. Mahasiswa akan dilatih dengan tugas perancangan kompilator sederhana.']);
$this->insert('{{%course_description}}',['code'=>'IKO32353','description'=>'Kuliah ini membahas dasar-dasar pemelajaran mesin (machine learning), yaitu teknik pengembangan perangkat lunak yang dapat menghasilkan model untuk menjelaskan suatu fenomena kompleks dengan cara mengamati sejumlah data. Metode- metode yang diajarkan berbasis pendekatan statistik untuk pengenalan pola, antara lain perceptron, support vector machines, hidden Markov models, expectation maximization, dan lain-lain']);
$this->insert('{{%course_description}}',['code'=>'IKO32354','description'=>'Mata kuliah ini mempelajari berbagai teknik untuk membangun perangkat lunak yang mengolah bahasa manusia. Secara umum, struktur materi kuliah ini diatur sesuai dengan tingkat representasi bahasa, mulai dari (i) morfologi: finite state, two-level morphology, part of speech tagging, (ii) sintaksis: context free grammars, feature structure unification, probabilistic parsing, dan (iii) semantik: rule-based semantic analysis. Kuliah ini juga membahas analisa wacana (discourse) secara singkat. Meskipun kuliah ini lebih banyak fokus pada pendekatan simbolik yang bersifat top-down, beberapa metode statistik yang mutakhir (corpus linguistics) juga dibahas. Akan ada beberapa tugas yang melatih peserta kuliah untuk memahami pemodelan bahasa, di mana peserta akan membangun sebuah sistem perangkat lunak yang mampu mengolah masukan berupa bahasa manusia']);
$this->insert('{{%course_description}}',['code'=>'IKO32402','description'=>'Kuliah ini mengajarkan bagaimana merancang dan menganalisa sebuah algoritma dalam menyelesaikan persoalan-persoalan yang membutuhkan pemrograman. Dua isu utama yang ditekankan dalam merancang dan menganalisa algoritma tersebut adalah aspek kebenaran (correctness) dan kompleksitas (complexity). Berbagai teknik dan pendekatan akan dibahas, antara lain dynamic programming, greedy algorithm, backtracking, graph algorithms, approximation algorithms, dan lain-lain']);
$this->insert('{{%course_description}}',['code'=>'IKO32450','description'=>'Mata kuliah ini meliputi penjelasan sistem grafika, algoritma penanganan elemen-elemen dasar grafika, sistem 2D dan 3D, model iluminasi, model obyek, kurva dan permukaan. Peserta kuliah melatih pemrograman melalui tugas menggunaka bahasa OpenGL, baik secara perorangan maupun secara kelompok']);
$this->insert('{{%course_description}}',['code'=>'IKO32453','description'=>'Mata kuliah ini membahas kriptografi (dari pendekatan klasik sampai teknik modern) dan keamanan informasi yang meliputi berbagai aspek seperti penerapan teknik kriptografi dan sifat-sifat keamanan. Materi yang dibahas antara lain teknik enkripsi klasik, block cipher dan DES, finite fields, AES, enkripsi simetris, public key cryptography dan RSA, otentikasi pesan, tandatangan dijital serta protokol otentikasi']);
$this->insert('{{%course_description}}',['code'=>'IKO32751','description'=>'Mata kuliah ini membahas pengembangan aplikasi dan layanan perangkat lunak yang menggunakan teknologi web terkini. Topik-topik yang dibahas meliputi: review singkat mengenai standar-standar HTML dan XML, teknologi web service berbasis Servlet, Tomcat, JSP, isu teknis seperti cookies & session, SQL, JDBC, DAOs, JavaBeans & BeanFactories, paradigma MVC (Model View Controller), JSP Standard Tag Library, Security (Including SSL), Web Service (SOAP/WSDL/UDDI), Frameworks, Internationalization, Scalability & Performance Issues']);
$this->insert('{{%course_description}}',['code'=>'IKO41151','description'=>'Mata kuliah ini memperkenalkan dasar-dasar pemodelan sistem menggunakan simulasi komputer dan teknik matematik. Beberapa studi kasus akan dijabarkan baik dalam perkuliahan maupun dalam tutorial. Aplikasi yang didiskusikan meliputi cakupan yang luas, namun penekanan akan diberikan pada analisa sistem komputer dan komunikasi menggunakan beberapa paradigma permodelan seperti, simulasi, teori antrian, stochastic process algebra dan stochastic petrinets']);
$this->insert('{{%course_description}}',['code'=>'IKO41153','description'=>'Mata kuliah ini memperkenalkan analisis sebuah rancangan sistem nonliniar. Topik yang dipelajari meliputi: linearization, equilibrium points, limit cycles, chaotic attractors, stability, Liapunov?s methods, describing functions, Popov and circle criteria, contraction mappings, exact linearization, variable structure, simulation']);
$this->insert('{{%course_description}}',['code'=>'IKO41154','description'=>'Mata kuliah ini memberikan pemelajaran terkait komputasi pada aljabar linear. Fokus perkuliah pada komputasi matriks, terutama pada aspek sensitivity dan numerical stability, square system, least squares problems, eigen problems, SVD serta pengaplikasiannya pada berbagai isu komputasional']);
$this->insert('{{%course_description}}',['code'=>'IKO41251','description'=>'Mata kuliah ini membahas perancangan dan implementasi permainan komputer (computer games) dari berbagai konsep dan isu-isu terkini yang menantang. Perkuliahan akan diakhir dengan proyek kelompok yang difokuskan pada perancangan dan pengembangan sebuah game yang inovatif']);
$this->insert('{{%course_description}}',['code'=>'IKO41253','description'=>'Tujuan mata kuliah ini adalah untuk memperkenalkan prinsip-prinsip pemrograman berbasis logika menggunakan bahasa pemrograman Prolog. Konsep-konsep dasar seperti unification dan resolution juga akan dibahas. Aplikasi dan penerapan aspek-aspek ini akan didemonstrasikan melalui serangkaian studi kasus']);
$this->insert('{{%course_description}}',['code'=>'IKO41254','description'=>'Mata kuliah ini meliputi topik-topik yang terkait dengan penjaminan mutu perangkat lunak. Mata kuliah ini mempelajari penggabungan berbagai teknik dan komponen PMPL, seperti: kegiatan PMPL yang biasanya dilakukan pihak eksternal, penerapan aktivitas PMPL terhadap penjadwalan proyek dan kendali anggaran, isu-isu implementasi PMPL, pertimbangan manajemen risiko PMPL, dan biaya yang terkait dengan PMPL. Mata kuliah ini juga membahas isu mutu sepanjang proses pengembangan perangkat lunak, termasuk rancangan, implementasi, pengujian, dan pengoperasian. Isu-isu terkait dengan kegiatan pra- proyek dan pasca-proyek juga akan dibahas. Standar mutu yang relevan juga akan dibahas']);
$this->insert('{{%course_description}}',['code'=>'IKO41352','description'=>'Kuliah ini membahas bagaimana menangani masalah impresisi dan ketidakpastian dengan pendekatan fuzzy. Topik yang dibahas meliputi konsep ketidakpastian, logika fuzzy vs. klasik, bilangan dan himpunan fuzzy serta operasinya, graf dan relasi fuzzy, fungsi dan inferensi fuzzy, defuzzifikasi, dan lain-lain']);
$this->insert('{{%course_description}}',['code'=>'IKO41356','description'=>'Mata kuliah ini mengajarkan prinsip-prinsip representasi, transmisi, serta authoring dan anotasi terhadap data multimedia, baik teks, audio, citra, maupun video. Mata kuliah ini juga memberikan pemahaman teoritis maupun praktis mengenai standar-standar terkini seperti XML, PDF, MP3, MIDI, JPEG, SVG, AVI, OGM, dan seterusnya']);
$this->insert('{{%course_description}}',['code'=>'IKO41357','description'=>'Mata kuliah ini membahas konsep-konsep dasar perolehan informasi dalam mengorganisir dan memperoleh kembali data teks dan multimedia']);
$this->insert('{{%course_description}}',['code'=>'IKO41361','description'=>'Mata kuliah ini memperkenalkan konsep dasar yang terkait dengan Semantic Web, yaitu jaringan yang dilengkapi dengan metode dan teknik untuk menambahkan makna atau arti terhadap data yang tersedia, sehingga dapat diolah secara otomatis oleh sistem yang cerdas']);
$this->insert('{{%course_description}}',['code'=>'IKO41452','description'=>'Mata kuliah ini mengajarkan konsep-konsep geometris serta alat bantu yang dibutuhkan untuk mengatasi masalah yang muncul dalam perancangan geometris berbasis komputer (Computer-Aided Geometric Design, atau CAGD), grafika komputer, computer vision, dan motion planning. Mata kuliah ini menangani obyek-obyek seperti kurva dan permukaan dari sudut pandang algoritmis']);
$this->insert('{{%course_description}}',['code'=>'IKO41454','description'=>'Mata kuliah ini membahas dengan detil logika klasik (logika proposisi serta logika predikat orde pertama) dengan menitikberatkan aspek-aspek sintaks, semantik serta komputasional. Mata kuliah ini juga membahas topik-topik lanjut seperti logika non- klasik dan beberapa aplikasinya, seperti equational logics, modal logics, type theory, higher order logics, dan nonmonotonic logics']);
$this->insert('{{%course_description}}',['code'=>'IKO41552','description'=>'Mata kuliah ini akan memfokuskan pada konsep pemrosesan sinyal dijital (digital signal processing, atau DSP), baik yang berupa audio, video atau bentuk sinyal lain yang dihasilkan dari sensor/transducer, serta bagaimana pemrosesan tersebut dapat mengolah data sinyal menjadi lebih bermanfaat untuk mendukung berbagai aplikasi. Beberapa dasar teori akan diperkenalkan seperti konversi ADC/DAC, probabilitas dan derau, sistem linier, serta operasi konvolusi, lalu membahas pemrosesan seperti transformasi Fourier, berbagai jenis filter dijital, pemampatan data, serta aspek implementasi pada mikrokontroler']);
$this->insert('{{%course_description}}',['code'=>'IKO41554','description'=>'Mata kuliah ini mengeksplorasi isu-isu yang terkait dengan perancangan dan implementasi dari sistem terdistribusi dengan penekanan pada bagaimana shared state antara beberapa proses dalam sebuah sistem.']);
$this->insert('{{%course_description}}',['code'=>'IKO41557','description'=>'Komputasi ubiquitous, atau disebut juga sebagai komputasi pervasive, merupakan visi sistem komputer yang merasuk ke dalam dunia fisik dan lingkungan sosial manusia. Salah satu tujuannya adalah untuk membuat komputer yang dapat dioperasikan dalam lingkungan fisik yang beragam, dan membangun teknologi yang sadar tentang lingkungan sekitarnya dan dapat diakses dan digunakan oleh manusia dan lingkungan sosial secara harmonis. Pada komputasi ubiquitous, informasi dapat diolah oleh obyek dan kegiatan sehari-hari']);
$this->insert('{{%course_description}}',['code'=>'IKO41853','description'=>'Mata kuliah ini membahas dasar-dasar pengajaran dan pembelajaran menggunakan teknologi komputer. Topik yang dibahas meliputi prinsip pembelajaran dasar, proses pembelajaran dan ingatan pada manusia, teori pembelajaran (kognitif, behaviourism, constructivism), pembelajaran tatap muka vs. jarak jauh, konten multimedia, evaluasi berbagai sistem manajemen pembelajaran (learning management system, atau LMS). Peserta diharapkan memiliki ketrampilan pemrograman yang cukup, terutama untuk melakukan scripting dalam mengevaluasi berbagai LMS']);
$this->insert('{{%course_description}}',['code'=>'IKO41854','description'=>'Mata kuliah ini membahas konsep, teori, serta teknik-teknik untuk mengakuisisi, merepresentasikan, mengolah, dan memanfaatkan data geospasial seperti peta (map). Topik yang dibahas meliputi data vektor vs. raster, representasi dan pengorganisasian data geospasial serta peta, kualitas dan standar data geospasial, integrasi GIS dan remote sensing, implementasi GIS']);
$this->insert('{{%course_description}}',['code'=>'IKO42252','description'=>'Mata kuliah ini ditujukan untuk memenuhi kebutuhan terhadap kerangka pendekatan formal dalam rangka pembuatan perangkat lunak kritis yang bermutu tinggi. Kuliah ini memberikan landasan yang kokoh berbasis logika, perkenalan terhadap beberapa kerangka logika yang digunakan dalam pemodelan dan penalaran sistem komputer. Hal ini membutuhkan pelatihan formal yang memungkinkan peserta kuliah untuk memiliki ketrampilan dalam menggunakan kerangka yang ada']);
$this->insert('{{%course_description}}',['code'=>'IKO42256','description'=>'Mata kuliah ini akan membahas perkembangan riset dan teknologi terkini pada bidang teknologi perangkat lunak. Isi materinya akan disesuaikan dengan isu-isu terkini pada saat mata kuliah ditawarkan.']);
$this->insert('{{%course_description}}',['code'=>'IKO42351','description'=>'Mata kuliah ini memperkenalkan konsep-konsep dasar serta masalah, metode, serta teknik dalam penambangan data']);
$this->insert('{{%course_description}}',['code'=>'IKO42358','description'=>'Mata kuliah ini akan membahas perkembangan riset dan teknologi terkini pada bidang kecerdasan komputasional. Isi materinya akan disesuaikan dengan isu-isu terkini pada saat mata kuliah ditawarkan.']);
$this->insert('{{%course_description}}',['code'=>'IKO42359','description'=>'Mata kuliah ini akan membahas perkembangan riset dan teknologi terkini pada bidang pengolahan informasi multimedia. Isi materinya akan disesuaikan dengan isu-isu terkini pada saat mata kuliah ditawarkan.']);
$this->insert('{{%course_description}}',['code'=>'IKO42360','description'=>'Mata kuliah ini memberikan pengantar tentang implementasi robot dari sudut pandang ilmu komputer. Topik yang dibahas meliputi gerakan dengan roda ataupun kaki (locomotion), penginderaan dan persepsi dengan sensor, penanganan ketidakpastian pada persepsi, representasi dan pemodelan lokasi secara probabilistik, Markov localization, Kalman filter. Pada mata kuliah ini mahasiswa akan menggunakan perangkat dan peralatan seperti software Open Dynamic Engine serta robot Lego MindStorm']);
$this->insert('{{%course_description}}',['code'=>'IKO42451','description'=>'Mata kuliah ini mengajarkan solusi-solusi algoritma modern terhadap berbagai persoalan geometri yang muncul pada aplikasi-aplikasi grafika komputer, sistem informasi geografis, dan robotika. Beberapa permasalahan, teknik, serta algoritma yang dibahas antara lain convex hull, intersection, triangulation, diagram Voronoi, Painter\'s algorithm, serta robot motion planning']);
$this->insert('{{%course_description}}',['code'=>'IKO42553','description'=>'Mata kuliah ini ditujukan untuk memahami teknik rancangan sistem dijital menggunakan bahasa pemrograman tingkat tinggi (High Level Language). Bahasa yang digunakan adalah VHDL (VHSIC Hardware Description Language). Materi kuliah yang diberikan mencakup pemahaman elemen-elemen VHDL, teknik pemodelan perilaku (behavior), pemodelan dataflow dan pemodelan secara struktural. Elemen-elemen pemrograman yang dibahas termasuk konsep konfigurasi, subprogram, overloading, package dan library, termasuk contoh- contoh pemodelan rangkaian dijital yang umum dijumpai pada sistem dijital. Sarana pendukung laboratorium adalah seperangkat board FPGA dan development tools dari Xilinx']);
$this->insert('{{%course_description}}',['code'=>'IKO42555','description'=>'Mata kuliah ini akan membahas perkembangan riset dan teknologi terkini pada bidang arsitektur dan infrastruktur komputer. Isi materinya akan disesuaikan dengan isu-isu terkini pada saat mata kuliah ditawarkan.']);
$this->insert('{{%course_description}}',['code'=>'IKS12600','description'=>'Mata kuliah ini memperkenalkan kepada mahasiswa dasar pengetahuan bisnis yang memungkinkan siswa untuk mengembangkan kemampuan mereka dalam dunia bisnis']);
$this->insert('{{%course_description}}',['code'=>'IKS12800','description'=>'Mata kuliah ini membahas mengenai konsep sistem, komponen-komponen sistem dan keterkaitannya; pemodelan proses bisnis: cross functional flow, diagram aktivitas; biaya/nilai dan kualitas informasi; keunggulan kompetitif dan informasi; spesifikasi, desain dan rekayasa sistem Informasi; aplikasi versus perangkat lunak sistem; analisis arus informasi; paket solusi perangkat lunak, kualitas, TQM dan rekayasa ulang; tingkat sistem: strategis, taktis dan operasional, jenis aplikasi komputer, komponen sistem dan keterkaitannya; strategi-strategi sistem informasi; peran informasi dan teknologi informasi, kebutuhan informasi, peran pengguna SI']);
$this->insert('{{%course_description}}',['code'=>'IKS21501','description'=>'Mata kuliah ini memperkenalkan konsep dasar arsitektur komputer yang mencakup pemahaman dasar system digital dan komponen-komponen utama yang membangun komputer digital. Mata kuliah ini merupakan gabungan materi PSD, POK dan OSK yang memberi landasan pengetahuan bagi mahasiswa stream Sistem Informasi']);
$this->insert('{{%course_description}}',['code'=>'IKS21601','description'=>'Mata kuliah ini mempelajari konsep dasar fungsi- fungsi manajemen dalam lingkungan bisnis. Penekanan dari mata kuliah ini adalah pendekatan fungsional termasuk perencanaan, pengorganisasian, staffing, koordinasi, kepemimpinan, dan pengontrolan']);
$this->insert('{{%course_description}}',['code'=>'IKS22403','description'=>'Mata kuliah ini mengajarkan pemodelan Linear Programming (LP), pemahaman metodologi/algoritma terkait dan penggunaan dalam persoalan-persoalan pemrograman linier serta varian-variannya']);
$this->insert('{{%course_description}}',['code'=>'IKS22602','description'=>'Mata kuliah ini berfokus pada metodologi dan praktik ERP sebagai solusi bisnis perusahaan yang lengkap. mata kuliah ini sesuai untuk mahasiswa yang berencana menjadi konsultan ERP atau menjadi pengguna ERP di perusahaan. mata kuliah ini akan mengajarkan siswa modul penjualan dan distribusi, manajemen material, dan perencanaan produksi']);
$this->insert('{{%course_description}}',['code'=>'IKS31259','description'=>'Tujuan dari mata kuliah ini adalah untuk mengembangkan pemahaman konsep dan prinsip- prinsip Manajemen Proyek Teknologi Informasi, berdasarkan PMBOK Guide Third Edition']);
$this->insert('{{%course_description}}',['code'=>'IKS31504','description'=>'Mata kuliah ini memperkenalkan model referensi ISO-OSI untuk merancang jaringan komunikasi data. Topik-topik yang akan dibahas meliputi: Arsitektur jaringan, ISO-OSI, Application layer, Transport layer, Network layer, LAN, dan wireless networking']);
$this->insert('{{%course_description}}',['code'=>'IKS31603','description'=>'Mata kuliah ini mengajarkan pemahaman dan aplikasi dari konsep dan prinsip-prinsip CRM. Materi yang diajarkan meliputi customer driven, praktik- praktik berbasiskan pasar yang memungkinkan sebuah bisnis menjadi menarik, serta teknik-teknik dalam memuaskan dan mempertahankan profitabilitas pelanggan']);
$this->insert('{{%course_description}}',['code'=>'IKS31604','description'=>'Mata kuliah ini berfokus pada pemahaman dasar konsep dan teknik manajemen SDM. mata kuliah ini akan menyoroti aplikasi praktis yang dapat digunakan untuk menangani kegiatan rutin terkait pengelolaan SDM, serta perencanaan personil dan kontribusinya. Isu yang dibahas meliputi rekrutmen, penempatan, pelatihan dan pengembangan, kompensasi serta relationship dengan pegawai dan keamanan karyawan']);
$this->insert('{{%course_description}}',['code'=>'IKS31605','description'=>'Mata kuliah ini berfokus pada metodologi dan praktek SCM sebagai solusi bisnis pada skala enterprise. mata kuliah ini sesuai untuk mahasiswa yang berencana menjadi seorang konsultan TI atau perusahaan manufaktur. mata kuliah ini akan mengajarkan mahasiswa konsep dasar dan implementasi SCM dengan mengilustrasikan kompleksitas dari perencanaan kolaboratif dalam sebuah rantai pasokan (supply chain).']);
$this->insert('{{%course_description}}',['code'=>'IKS31650','description'=>'Mata kuliah ini akan memperkenalkan pada mahasiswa prinsip-prinsip dasar e-commerce, dari perspektif bisnis. mata kuliah ini memberikan materi tentang bisnis dan teknologi, seperti ritel Internet dan berbagai model e-commerce. Selain itu, mata kuliah ini juga membahas beberapa isu utama yang terkait dengan e-commerce seperti keamanan, privasi, hak kekayaan intelektual, otentikasi, enkripsi, kebijakan penggunaan, dan tanggung jawab hukum']);
$this->insert('{{%course_description}}',['code'=>'IKS31951','description'=>'Mata kuliah ini berfokus pada strategi dan keterampilan untuk menulis dan berbicara yang efektif dalam organisasi bisnis. mata kuliah ini akan mengajarkan siswa teknik-teknik dasar komunikasi yang berguna dalam konteks sehari-hari organisasi/bisnis']);
$this->insert('{{%course_description}}',['code'=>'IKS32206','description'=>'Melalui mata kuliah ini mahasiswa diharapkan mampu mengembangkan aplikasi dalam skala besar dengan tetap memperhatikan kaidah-kaidah di dalam rekayasa perangkat lunak']);
$this->insert('{{%course_description}}',['code'=>'IKS32606','description'=>'Mata kuliah ini mengembangkan pemahaman konsep dan prinsip-prinsip Akuntansi, serta pemahaman konsep dan prinsip-prinsip Sistem Informasi Akuntansi sebagai bagian dari Sistem Informasi organisasi']);
$this->insert('{{%course_description}}',['code'=>'IKS32656','description'=>'Mata kuliah ini berfokus pada teori dan praktek dalam mengkonfigurasi sistem ERP sebagai solusi bisnis yang berskala enterprise. mata kuliah ini sesuai bagi mahasiswa yang ingin bekerja sebagai konsultan TI maupun ERP. mata kuliah ini akan mengajarkan mahasiswa bagaimana mengkonfigurasi SAP, yang merupakan salah satu software ERP, sebagai power user maupun admin SAP']);
$this->insert('{{%course_description}}',['code'=>'IKS32753','description'=>'Kuliah ini memperkenalkan konsep dasar administrasi sistem dan jaringan. Mahasiswa akan dikenalkan dengan pembahasan awal tentang jaringan client/server modern dan mahasiswa juga akan dilatih melakukan instalasi, konfigurasi, dan maintenance terhadap client, server serta beragam services. Pembahasan mencakup: pengantar administrasi sistem, konfigurasi client, server, dan jaringan, otomatis menggunakan services dan shell scripts, performance monitoring dan pengenalan ke pengamanan sistem']);
$this->insert('{{%course_description}}',['code'=>'IKS32756','description'=>'Mata kuliah ini memperkenalkan infrastruktur Teknologi Informasi (TI) modern dan aktivitas- aktivitas yang diperlukan untuk pengelolaan operasional infrastruktur tersebut']);
$this->insert('{{%course_description}}',['code'=>'IKS32758','description'=>'Mata kuliah ini berfokus pada penyampaian dan dukungan layanan TI yang sesuai dengan kebutuhan bisnis organisasi']);
$this->insert('{{%course_description}}',['code'=>'IKS32855','description'=>'Mata kuliah ini mempelajari berbagai proses bisnis yang berlaku dalam bidang kesehatan. Hal-hal yang dibahas meliputi pemahaman proses bisnis dan pengembangan sistem informasi di bidang kesehatan, baik itu di bidang penyedia layanan kesehatan, asuransi, maupun layanan medis darurat']);
$this->insert('{{%course_description}}',['code'=>'IKS32901','description'=>'Mata kuliah ini berfokus pada metodologi penelitian untuk Sistem Informasi (SI) dan teknologi informasi (TI). mata kuliah ini memberikan landasan sikap mahasiswa agar bisa berfikir secara ilmiah. mata kuliah ini menekankan mahasiswa agar mampu berpikir kritis dalam proses ilmiah. mata kuliah ini akan berkaitan dengan bagaimana melakukan penelitian di bidang SI/TI, sehingga mahasiswa bisa mengelola sumber daya penelitian secara optimal. Selain itu, mata kuliah ini juga akan mengeksplorasi peran penelitian sebagai fungsi utama dalam mendorong pemahaman dan pembentukan pengetahuan baru dalam bidang SI/TI. mata kuliah ini akan mencakup topik-topik seperti: penalaran untuk melakukan penelitian, memahami proses penelitian, mengeksplorasi berbagai pendekatan untuk melakukan penelitian termasuk penggunaan berbagai metode penelitian, menafsirkan hasil penelitian, dan penulisan laporan penelitian. Beberapa paradigma penelitian dan metode terkini akan disesuaikan dengan bidang SI/TI. Pendekatan dasar mata kuliah ini adalah agar mahasiswa mengerjakan tugas-tugas yang diberikan dan berlatih melakukan penelitian']);
$this->insert('{{%course_description}}',['code'=>'IKS41652','description'=>'Mata kuliah ini memperkenalkan mahasiswa tentang konsep pengembangan produk dan pemasaran. Selain itu mahasiswa juga akan dibekali kemampuan untuk menganalisa kebutuhan pasar, merancang dan mengembangkan produk baru seperti perangkat lunak atau layanan konsultasi SI/TI, pengujian pasar, dan sebagainya']);
$this->insert('{{%course_description}}',['code'=>'IKS41653','description'=>'Mata kuliah ini bertujuan memberi pemahaman kepada mahasiswa secara konseptual dan aplikasi mengenai pengaruh perilaku (behavioral) terhadap kinerja (performance) dan produktivitas kerja pada tingkat individual, kelompok dan organisasi']);
$this->insert('{{%course_description}}',['code'=>'IKS41757','description'=>'Mata kuliah ini membahas mengenai keamanan komputer. Topik yang dibahas mencakup antara lain: Management keamanan (informasi, kebijakan, prosedur), Management resiko, Model dan tingkat keamanan pada jaringan, peralatan, aplikasi, serta kontol akses dan keamanan fisik. Kuliah ini juga mencakup topik topik yang terkait dengan BCP dan DRP, serta investigasi kejahatan komputer (forensics)']);
$this->insert('{{%course_description}}',['code'=>'IKS41759','description'=>'Mata kuliah ini merupakan pengantar bidang komunikasi mobile yang ditujukan untuk memberikan gambaran umum tentang teknologi mobile dari sudut pandang ilmu komputer. Pada awal perkuliahan, diberikan beberapa dasar tentang teknologi transmisi nirkabel. Topik yang dibahas meliputi: frekuensi yang digunakan untuk komunikasi, sinyal, skema dasar multiplexing dan modulasi, protokol akses, serta persyaratan aplikasi. Berbagai teknologi akses juga diajarkan dalam mata kuliah ini untuk jaringan tetap, jaringan nirkabel, jaringan nirkabel telepon bergerak dll. Setelah pengenalan konsep-konsep dasar, mata kuliah ini akan memperkenalkan sistem selular secara lebih mendalam. Berbagai teknologi mobile masa depan sistem digital seperti CDMA, GSM, DECT, W-CDMA, CDMA2000, UMTS dll juga akan diperkenalkan sebagai bagian dari sistem komunikasi mobile. Selain itu teknologi terbaru seperti WiMAX dan MBWA juga akan dibahas termasuk gambaran skenario integrasi 3G dan WLAN. Beberapa permasalahan lain seperti mobile IP dan cognitive radio juga akan diajarkan dalam mata kuliah ini untuk memberikan gambaran konseptual dari topik-topik terbaru.']);
$this->insert('{{%course_description}}',['code'=>'IKS41759','description'=>'Mata kuliah ini merupakan pengantar bidang komunikasi mobile yang ditujukan untuk memberikan gambaran umum tentang teknologi mobile dari sudut pandang ilmu komputer. Pada awal perkuliahan, diberikan beberapa dasar tentang teknologi transmisi nirkabel. Topik yang dibahas meliputi: frekuensi yang digunakan untuk komunikasi, sinyal, skema dasar multiplexing dan modulasi, protokol akses, serta persyaratan aplikasi. Berbagai teknologi akses juga diajarkan dalam mata kuliah ini untuk jaringan tetap, jaringan nirkabel, jaringan nirkabel telepon bergerak dll. Setelah pengenalan konsep-konsep dasar, mata kuliah ini akan memperkenalkan sistem selular secara lebih mendalam. Berbagai teknologi mobile masa depan sistem digital seperti CDMA, GSM, DECT, W-CDMA, CDMA2000, UMTS dll juga akan diperkenalkan sebagai bagian dari sistem komunikasi mobile. Selain itu teknologi terbaru seperti WiMAX dan MBWA juga akan dibahas termasuk gambaran skenario integrasi 3G dan WLAN. Beberapa permasalahan lain seperti mobile IP dan cognitive radio juga akan diajarkan dalam mata kuliah ini untuk memberikan gambaran konseptual dari topik-topik terbaru.']);
$this->insert('{{%course_description}}',['code'=>'IKS41850','description'=>'Mata kuliah ini berisi teori dan aplikasi Knowledge Management, yang juga mencakup teknologi dan tools yang digunakan dalam mengelola pengetahuan, diintegrasikan dengan kebutuhan manajemen dalam menyediakan pengetahuan dalam suatu organisasi secara efektif. Dalam mata kuliah ini juga dibahas ciri-ciri, computer representation, akses, dan pemanfaatan pengetahuan versus informasi dalam konteks sumberdaya manusia. mata kuliah ini juga memberikan persiapan pada pekerja-pekerja sistem, teknis, dan manajerial dalam menghadapi ekonomi berbasis pengetahuan']);
$this->insert('{{%course_description}}',['code'=>'IKS41851','description'=>'Audit Sistem Informasi/Teknologi Informasi (SI/TI) merupakan pemeriksaan kontrol dalam SI/TI sebuah organisasi. Audit SI/TI merupakan proses pengumpulan dan penilaian bukti-bukti dari sistem informasi, praktik, dan operasi dari organisasi. Evaluasi terhadap bukti yang diperoleh dipergunakan untuk menentukan apakah sistem informasi sudah menjaga aset, memelihara integritas data, dan beroperasi secara efektif untuk mencapai tujuan organisasi. Evaluasi ini dapat dilakukan bersamaan dengan audit laporan keuangan, audit internal, atau bentuk audit lainnya. mata kuliah ini memberikan dasar bagi mahasiswa untuk melakukan audit SI/TI. mata kuliah ini akan mencakup konsep audit SI/TI dan bagaimana melakukan audit SI/TI dalam suatu organisasi. Selain itu, mata kuliah ini akan memperkenalkan standar industri untuk melakukan audit SI/TI tersebut']);
$this->insert('{{%course_description}}',['code'=>'IKS41852','description'=>'Mata kuliah ini mempelajari bagaimana mengelola divisi sistem informasi / teknologi informasi di sebuah organisasi. Topik mencakup: perencanaan sistem informasi, manajemen pengembangan sistem, manajemen pemeliharaan, manajemen implementasi, help desk, user support service, operasi data centre, manajemen infrastruktur, manajemen inventori, kontrol dan evaluasi sistem informasi, akuisisi dan procurement sumber daya sistem informasi, manajemen personalia sistem informasi, end-user computing']);
$this->insert('{{%course_description}}',['code'=>'IKS42260','description'=>'Mata kuliah ini memberikan pengetahuan kepada mahasiswa sehingga mereka mampu mengimplementasikan dan mengembangkan software berbasis open source']);
$this->insert('{{%course_description}}',['code'=>'IKS42651','description'=>'Mata kuliah ini bertujuan membekali mahasiswa kemampuan bekerja dengan data dalam skala besar dan menguasai berbagai teknik untuk menilai informasi bisnis yang terkandung dalam data tersebut']);
$this->insert('{{%course_description}}',['code'=>'IKS42655','description'=>'Mempunyai kemampuan untuk mengembangkan bidang ilmu/teknologi atau melanjutkan studinya.']);
$this->insert('{{%course_description}}',['code'=>'IKS42755','description'=>'Mata kuliah ini berfokus pada integrasi sistem informasi dalam organisasi, proses dimana sistem komputer dan aplikasi perangkat lunak yang berbeda dihubungkan bersama secara fisik atau fungsional. Integrasi tersebut menggunakan strategi dan metode untuk menyatukan sekumpulan sistem yang saling bergantung menjadi suatu kesatuan fungsi, sehingga memungkinkan dua atau lebih aplikasi untuk berinteraksi dan bertukar data dengan lancar. mata kuliah ini akan mengeksplorasi cara dan teknik untuk melakukan integrasi sistem serta praktek manajemen yang telah terbukti dalam proyek- proyek integrasi']);
$this->insert('{{%course_description}}',['code'=>'IKS42760','description'=>'Mempunyai kemampuan untuk mengembangkan bidang ilmu/teknologi atau melanjutkan studinya.']);
$this->insert('{{%course_description}}',['code'=>'IKS42950','description'=>'Mata kuliah ini memberikan wawasan tentang kewirausahaan di bidang SI/TI.']);
$this->insert('{{%course_description}}',['code'=>'MAT10113','description'=>'Mata kuliah ini mengajarkan topik-topik berikut: sistem bilangan riil dan bilangan kompleks, pertidaksamaan dan harga mutlak, fungsi satu peubah, grafik (kartesian, polar, parameter), operasi pada fungsi, teorema limit, kekontinuan, rumus- rumus dasar, aturan rantai, turunan tingkat tinggi, turunan implisit, aplikasi turunan, integral tak tentu dan tentu, teorema dasar kalkulus, sifat dasar integral, teknik integrasi']);
$this->insert('{{%course_description}}',['code'=>'MAT10114','description'=>'Mata kuliah ini mengajarkan topik-topik lanjut dari Kalkulus sebagai berikut: aplikasi integral, bentuk tak tentu dan integral tak wajar, barisan dan deret tak hingga, geometri dalam ruang dan vektor, fungsi peubah banyak, integral lipat']);
